class CountryMaster {
  List<CountryDetails>? _country;

  List<CountryDetails>? get country => _country;

  CountryMaster({List<CountryDetails>? country}) {
    _country = country;
  }

  CountryMaster.fromJson(dynamic json) {
    if (json["country"] != null) {
      _country = [];
      json["country"].forEach((v) {
        _country?.add(CountryDetails.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    if (_country != null) {
      map["country"] = _country?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

